import './App.css';
import Appbar from './Pages/Appbar'
import Header from './Pages/Header'
import Intro from './Pages/Professor'
import Project from './Pages/Project'
import Footer from './Pages/Footer'
import Contact from './Pages/Contact'
function App() {
	return (
		<div className="App">
			<Appbar/>
			<Header/>
			<Intro/>
			<Project/>
			<Footer/>
			<Contact/>
		</div>
	);
}

export default App;
